// src/actions/houseActions.js
export const searchHouse = (keyword) => {
    return {
      type: 'SEARCH_HOUSE',
      payload: keyword
    }
  }
  
  export const filterHouse = (filters) => {
    return {
      type: 'FILTER_HOUSE',
      payload: filters
    }
  }
